class MainPage extends StatefulWidget {
  const MainPage({super.key});

  @override
  State<StatefulWidget> createState() => _State();
}
class _State extends State<MainPage> {

  //region variaveis

  AuthManager get _auth => AuthManager.auth;
  AlbunsProvider get _albuns => AlbunsProvider.i;

  bool _rootAlbumEmpty = true;
  bool _authChecked = false;

  //endregion

  //region overrides

  @override
  void initState() {
    super.initState();
    _init();
    _authChecked = _auth.isAuthenticated;
    _albuns.album.addListener(_checkRootAlbum);
    _checkRootAlbum();
  }

  @override
  Widget build(BuildContext context) {
    OkiManager.i.deviceSize = MediaQuery.of(context).size;

    if (!_authChecked) {
      return AuthPage(
        _auth.password,
        onSuccess: _onSuccess,
        onCancel: bloqueioType == 0 ? _onAuthCompleted : _onCancel,
      );
    }

    if (_rootAlbumEmpty) {
      return AlbumPage(album: _albuns.album);
    }

    return AlbumCollectionPage(
      album: _albuns.album,
      root: true,
      realOnly: true,
      showConfigMenu: true,
    );
  }

  //endregion

  //region metodos

  void _init() async {
    await Future.delayed(const Duration(milliseconds: 200)).then((value) {
      context.read<IdiomaProvider>().load();
    });
  }

  void _checkRootAlbum() {
    final ab = _albuns.album;
    _rootAlbumEmpty = ab.isEmpty || (ab.length == 1 && ab.values.first.isFavoritos);
    if (_rootAlbumEmpty) {
      ab.add(Album(
        id: randomString(),
        nome: idioma.geral,
      ));
    }

    setState(() {});
  }

  void _onSuccess() {
    AuthManager.auth.isAuthenticated = true;
    _onAuthCompleted();
  }

  void _onCancel() {
    SystemNavigator.pop();
  }

  void _onAuthCompleted() {
    _authChecked = true;
    setState(() {});
  }

  //endregion

}

